import axios from "axios";

export const customAxios = axios.interceptors.response.use(
  (res) => {
    return res;
  },
  (e) => {
    if (e.response.status === 401) {
      console.log("ER1ROR: ", e.response);
      alert(`401 - Unauthorized\n${e.response?.data}`);
    }
    return Promise.reject(e);
  }
);
